import React from 'react'

const Cart = props => {
    return (
        <div>
            <h3>Made it to cart!</h3>
            {props.location.cart.map
           ((val)=>{
            return (
                <div >

                    
                    <h3><strong>Description : </strong><strong>{val.Rest_Desc}</strong></h3>
                    
                    <h3><strong>Location : </strong><strong>{val.Rest_Location}</strong></h3>
                    <h3>----------------------------------------------------</h3>
                    
                    
                  
                </div>
            );
            

        })}
        </div>
    )
}
 
export default Cart
